import React, { Component } from 'react';

import classNames from 'classnames';
import './App.css';

import { Container, Row, Col, NavLink } from 'reactstrap';
import Academics from './Academics.js';
import AOS from 'aos';
import 'aos/dist/aos.css';
import Languages from './Languages.js';
import Fun from './Fun.js';
import Work from './Work.js';
import Projects from './Projects.js';
import {Tabs, Tab, Nav} from 'react-bootstrap'
import Anchor from './Anchor.js';
import Editor from './images/editor.png';
import Books from './images/books.png';
import Default from './images/default.png';
import Hobbies from './images/hobbies.png';
import Creativity from './images/creativity.png';
import Hover from './Hover.js';
import Card from './images/cardQR.png';
import google from './images/google.jpg'
import profileGoogle from './images/profileGoogle.png'
import filler from './images/filler.png'


class Home extends Component {

    componentDidMount(){
      AOS.init({
        duration : 1800,
      })
    }


  render() {

    return (
      <div className={classNames("bg-image", this.state)}>


        <div >


        <Container id="App-body">
                <Row>

                  <img className="grayscale"
                      src={profileGoogle}
                      alt="me"
                  />


                </Row>
        </Container>


          </div>

          <div class="bg-text">
            <h2>Blurred Background</h2>
            <h1 style="font-size:50px">I am John Doe</h1>
            <p>And I'm a Photographer</p>
          </div>


      </div>

    );
  }
}

export default Home;
